            <h1>About This App</h1>
            <p>This sam</p>
            <div style={{backgroundColor: 'black', padding: '4px 30px'}}>
                <span style={{ color: 'white', cursor: 'pointer' }} onClick={() => window.open('https://github.com/luidyas')}>Created by Luidy Dias</span>
            </div>
        </div>
    )
}

export default About
